import numpy as np
import plotly.graph_objects as go
import panel as pn
pn.extension('plotly')

# Define the safety factor function
def safety_factor(param1, param2):
    return np.sqrt(param1**2 + param2**2)

def plot_safety_factor(param1_max=10, param2_max=10):
    param1_values = np.linspace(0, param1_max, 100)
    param2_values = np.linspace(0, param2_max, 100)
    param1_grid, param2_grid = np.meshgrid(param1_values, param2_values)
    safety_factor_values = safety_factor(param1_grid, param2_grid)
    fig = go.Figure(data=[go.Surface(z=safety_factor_values, x=param1_grid, y=param2_grid)])
    fig.update_layout(
        title='Safety Factor as a Function of Parameters',
        scene=dict(
            xaxis_title='Parameter 1',
            yaxis_title='Parameter 2',
            zaxis_title='Safety Factor'
        ),
        autosize=True
    )
    return fig

pn.interact(plot_safety_factor, param1_max=(1, 20), param2_max=(1, 20))
